import React, { useState } from 'react';
import '../css/cardModal.css'; // We'll create this css too

const AddCardPopup = ({ onClose }) => {
    const [title, setTitle] = useState('');
    const [description, setDescription] = useState('');
    const [priority, setPriority] = useState('Medium');
    const [tags, setTags] = useState([]);
    const [tagInput, setTagInput] = useState('');
    const [mentionedUsers, setMentionedUsers] = useState([]);
    const [userInput, setUserInput] = useState('');
    const [note, setNote] = useState('');
  
    const handleAddTag = () => {
      if (tagInput.trim() !== '') {
        setTags([...tags, tagInput.trim()]);
        setTagInput('');
      }
    };
  
    const handleAddUser = () => {
      if (userInput.trim() !== '') {
        setMentionedUsers([...mentionedUsers, userInput.trim()]);
        setUserInput('');
      }
    };
  
    const handleSubmit = () => {
      const data = {
        title,
        description,
        priority,
        tags,
        mentionedUsers,
        notes: [{ content: note }],
      };
      console.log('New Card Data:', data);
  
      // TODO: API call to backend (POST data)
      onClose();
    };
  
    return (
      <div className="popup-overlay">
        <div className="popup-card">
          <button className="close-btn" onClick={onClose}>×</button>
  
          <h2>Add New Card</h2>
  
          <input 
            type="text" 
            placeholder="Title" 
            value={title}
            onChange={(e) => setTitle(e.target.value)}
          />
  
          <textarea 
            placeholder="Description" 
            value={description}
            onChange={(e) => setDescription(e.target.value)}
          />
  
          <div className="priority-section">
            <label>
              <input 
                type="radio" 
                name="priority" 
                value="High" 
                checked={priority === 'High'}
                onChange={(e) => setPriority(e.target.value)}
              /> High
            </label>
            <label>
              <input 
                type="radio" 
                name="priority" 
                value="Medium" 
                checked={priority === 'Medium'}
                onChange={(e) => setPriority(e.target.value)}
              /> Medium
            </label>
            <label>
              <input 
                type="radio" 
                name="priority" 
                value="Low" 
                checked={priority === 'Low'}
                onChange={(e) => setPriority(e.target.value)}
              /> Low
            </label>
          </div>
  
          <div className="tags-section">
            <input 
              type="text" 
              placeholder="Add Tag" 
              value={tagInput}
              onChange={(e) => setTagInput(e.target.value)}
            />
            <button type="button" onClick={handleAddTag}>Add Tag</button>
            <div className="tag-list">
              {tags.map((tag, index) => (
                <span key={index} className="tag">{tag}</span>
              ))}
            </div>
          </div>
  
          <div className="mentioned-users-section">
            <input 
              type="text" 
              placeholder="Mention User" 
              value={userInput}
              onChange={(e) => setUserInput(e.target.value)}
            />
            <button type="button" onClick={handleAddUser}>Add User</button>
            <div className="user-list">
              {mentionedUsers.map((user, index) => (
                <span key={index} className="user">{user}</span>
              ))}
            </div>
          </div>
  
          <textarea 
            placeholder="Notes" 
            value={note}
            onChange={(e) => setNote(e.target.value)}
          />
  
          <button className="submit-btn" onClick={handleSubmit}>
            Create Card
          </button>
        </div>
      </div>
    );
  };
  
  export default AddCardPopup;
